script: |
  super -f text -I q13412.spq | sort > q13412.out

inputs:
  - name: q13412.spq
    data: |
      SELECT - col1 AS col0 FROM tab2 (FORMAT parquet) WHERE - col0 * + - col1 * - col1 - col2 * + col1 NOT BETWEEN col2 AND 80;
  - name: tab2

outputs:
  - name: q13412.out
    data: |
      -51
      -67
      -77
